Option types in Diplomat are relatively straightforward, you simply use Option<T> and it turns into the idiomatic equivalent over FFI. The main thing to note is that Option<T> currently only works when wrapping reference types. #[diplomat::bridge]
mod ffi { // just exists so we can get methods #[diplomat::opaque] struct Thingy; impl Thingy { fn maybe_create() -> Option<Box<Thingy>> { Some(Box::new(Thingy)) } }
} In C++ this will return a std::option<Thingy>, and in JS it will return a potentially-null object.

