When using Diplomat, you'll need to define Rust modules that contain the Rust APIs you want to expose. You can do this by using the diplomat::bridge macro: #[diplomat::bridge]
mod ffi { pub struct MyFFIType { pub a: i32, pub b: bool, } impl MyFFIType { pub fn create() -> MyFFIType { MyFFIType { a: 42, b: true } } pub fn do_a_thing(&self) { println!("doing thing {:?}", self.b); } }
} This is a simple struct with public fields; which is easier to reason about in an introductory example. Most APIs exposed via Diplomat will be via "opaque types", to be covered in the chapter on opaque types . Every type declared within a diplomat::bridge module along with all methods in its associated impl will be exposed over FFI. For example, the above code will generate the following extern API: #[no_mangle]
extern "C" fn MyFFIType_create() -> MyFFIType { MyFFIType::create()
} #[no_mangle]
extern "C" fn MyFFIType_do_a_thing(this: &MyFFIType) { this.do_a_thing()
} We can then generate the bindings for this API using the diplomat-tool CLI.

